import React from "react";
import "../../App.css";
import Footer from "../Footer";
import Cards from "../Cards";
import ContactUs from "../contactForm";
function ContactUsPage() {
  return (
    <>
      <ContactUs />
      <Cards />
      <Footer />
    </>
  );
}

export default ContactUsPage;
